import React, {useEffect, useState} from "react";
import Carrinho from "../Carrinho/carrinho";
import Card from "../Card/card";
import './body.css'
import axios from "axios";


function Body(props) {
const [list, setList] = useState([]);


    useEffect(() => {

    axios
  
    .get('https://mks-challenge-api-frontend.herokuapp.com/api/v1/products?page=1&rows=8&sortBy=id&orderBy=ASC')
        .then((response) => {
          //console.log(response.data)
         // setList(response.data)
         
         setList(response.data.products)
         
        })
        .catch((err)=>{
          console.log(err);
        })        

    }, []);

    return(
     <div> 
        <>
        <hr />
        {list.map(item => <>{JSON.stringify(item.name)}</>)}
        <hr />
        </>

        <div className="cards">
          
            <div className="grupo-card1">
            
                <div className="cards0">
                
                    <Card/>
                </div>

                <div className="cards1">
                    <Card />
                </div> 

                <div className="cards2">
                    <Card />
                </div> 

                <div className="cards3">
                    <Card />
                </div>     
            </div>

            <div className="grupo-card2">
                <div className="cards4">
                    <Card />
                </div>

                <div className="cards5">
                    <Card />
                </div> 

                <div className="cards6">
                    <Card />
                </div> 

                <div className="cards7">
                    <Card />
                </div>     
            </div>
            
            


        </div>


        </div>

    );
    
}

export default Body;
